import React, { Component } from 'react';
import styled from 'styled-components';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const Wrapper = styled.div`

  background-color: white;
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  color: #305077;

  a {
    text-decoration: none;
    color: #305077;
  }

  h2 {
    font-size: 20px;
    margin-bottom: 10px;
    font-weight: 700;
  }

  .contact {
    display: flex;
    flex-wrap: wrap;
    max-width: 800px;
    justify-content: center;
  }

  .chunk {
    margin: 10px;
    border: 1px solid #4d4d4d;
    padding: 20px;
    max-width: 500px;
  }

`

const Logo = styled.div`

  height: 400px;
  width: 400px;
  background-repeat: no-repeat;
  background-position: center;
  background-image: url(img/logo.svg);
  margin: 40px;



`

class App extends Component {
  render() {
    return (
      <Wrapper>
        <Logo>

        </Logo>
        <div className="contact">
          <div className="chunk">
            <h2>General Inquiries</h2>
            <a href="mailto:contact@parkletsband.com">contact@parkletsband.com</a>
          </div>
          <div className="chunk">
            <h2>Booking</h2>
            <a href="mailto:booking@parkletsband.com">booking@parkletsband.com</a>
          </div>
          <div className="chunk">
            <h2>Press</h2>
            <a href="mailto:press@parkletsband.com">press@parkletsband.com</a>
          </div>
          <div className="chunk">
            <h2>Other Business</h2>
            <a href="mailto:management@parkletsband.com">management@parkletsband.com</a>
          </div>
          <div className="chunk">
            <h2>Fans</h2>
            <a href="mailto:management@parkletsband.com">fans@parkletsband.com</a>
          </div>
        </div>
      </Wrapper>
    );
  }
}

export default App;
